export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:d,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:e,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:e,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:e,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:d,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},WxMqaB331H:{data:{id:1827,attributes:{imdbId:"tt8914012",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BN2UyYjQzMjMtMGQzOC00ZjE5LWE5OTctY2Q1NGY2YTM1YTQ5XkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg",type:d,ratings:[{Source:"Internet Movie Database",Value:"7.4\u002F10"}],item_lang:{data:{id:2490,attributes:{title:g,plot:"It's been several months since a mysterious portal opened up in the sky, spawning various monsters and zombies, and thus effectively dooming the human civilization. With all the adults and cool kids either zombified or evacuated to unknown safe zones by the remnants of the Military, teenager Jack Sullivan finds himself no longer the awkward, ignored kid he once was in his abandoned hometown. He and his surviving friends are determined to survive the apocalypse in style as the apex predators of this brave new world, made difficult by guests from the other side, rampant monsters, and the endless zombie horde.",slug:"the-last-kids-on-earth"}}},books:{data:[{id:9276,attributes:{title:g,description:"Forty-two days ago I was an ordinary kid, living an uneventful life. But now it's total monster zombie chaos and I'm battling beasts on a daily basis. Crazy, right? But I know exactly how to make it through the zombie apocalypse.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-P-VwwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:h,publisher:a,subtitle:a}},{id:9277,attributes:{title:"The Last Kids on Earth and the Midnight Blade",description:"Now a Netflix original series! The fifth book in the New York Times, USA Today, and Wall Street Journal bestselling series, with over 7 million copies in print! \"Terrifyingly fun! Delivers big thrills and even bigger laughs.\"--Jeff Kinney, author of the #1 New York Times bestseller Diary of a Wimpy Kid The 5th book of the New York Times bestselling series! Surviving their first winter after the Monster Apocalypse was no easy feat, yet Jack and his buddies waste no time springing to action against some of the nastiest, most evil monsters around. When Jack discovers his Louisville Slicer has new, otherworldly powers, he's thrown into epic training to find out what kind of destruction the blade can wield. But between fighting off zombies, fleeing from strange, glowy Vine-Thingies erupting from the ground, and squeezing in a video game session or two, there's barely time left to figure out what's wrong with their buddy, Dirk, who's been acting weird any time he's around the undead. When an unexpected villain appears, can Jack and his friends save themselves--and the rest of the world--from cosmic domination? Note: most illustrations are printed in black-and-white, with the occasional gray-and-white image.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=FIqDDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b,"Douglas Holgate"],firstBook:c,published:"2019-09-17",publisher:i,subtitle:a}},{id:9278,attributes:{title:"Last Kids on Earth and the Midnight Blade",description:"Surviving their first winter after the Monster Apocalypse was no easy feat, yet Jack and his buddies waste no time springing to action against some of the nastiest, most evil monsters around. When Jack discovers his Louisville Slicer has new, otherworldly powers, he's thrown into epic training to find out what kind of destruction the blade can wield. But between fighting off zombies, fleeing from strange, glowy Vine-Thingies erupting from the ground, and squeezing in a video game session or two, there's barely time left to figure out what's wrong with their buddy, Dirk, who's been acting weird any time he's around the undead.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=iOJdzQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2020-06-01",publisher:a,subtitle:a}},{id:9279,attributes:{title:"The Last Kids on Earth and the Zombie Parade",description:"Wimpy Kid meets The Walking Dead in this hilarious post-apocalyptic graphic novel series, soon to be a major NETFLIX series! Jack Sullivan is back. It's still TOTAL MONSTER ZOMBIE CHAOS on the streets, but now Jack has a gang of friends to help him through - science genius and best friend Quint, super-strong Dirk and all-round coolest girl ever, June. Not to mention Rover, Jack's awesome monster pet! Plus the treehouse is more souped up than ever, chockablock with defensive gizmos and ready to withstand anything that the monster apocalypse can throw at it.Which is just as well, because there's something extra-big and extra-monstrous marching right around the corner . . . The Last Kids on Earth series: The Last Kids on Earth The Last Kids on Earth and the Zombie Parade The Last Kids on Earth and the Nightmare King The Last Kids on Earth and the Cosmic Beyond",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=1680xAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:h,publisher:a,subtitle:a}},{id:9280,attributes:{title:"The Last Kids on Earth and the Skeleton Road",description:"Now a Netflix Original Series! The highly-anticipated sixth book in the New York Times, USA Today, and Wall Street Journal bestselling series, with over 7 million copies in print! \"Terrifyingly fun! Delivers big thrills and even bigger laughs.\"—Jeff Kinney, author of the #1 New York Times bestseller Diary of a Wimpy Kid Jack Sullivan, Quint Baker, June Del Toro, and Dirk Savage are about to have their biggest adventure yet. That's right—it's ROAD TRIP TIME! Now wielding the Midnight Blade, Jack Sullivan and the gang are furiously searching for the villainous Thrull and his skeleton army. The clock is ticking: the enemy has begun constructing the Tower--a portal with the power to bring Rezzoch the Ancient, Destructor of Worlds, to our dimension. Equipped with a crucial clue discovered by June on her Wild Flight, the group does the once-unthinkable: they leave Wakefield behind and embark on an . . . EPIC ROAD TRIP! That means music blasting, kitschy roadside attractions, snacks snacks snacks, dangerous detours, and a slew of skeletons and monsters at every turn. But this is no ordinary post-apocalyptic joyride. Because soon, they are pursued by a new threat: the return of a monster they thought long dead, who has taken on a terrifying new form. Jack, June, Quint, and Dirk will be lucky to make it far enough to find the answers they seek. But when the future of the world depends on it, these heroes don't pump the brakes—they go full throttle. Told in a mixture of text and black-and-white illustration, this is the perfect series for any kid who's ever dreamed of starring in their own comic book or video game.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=c8HQDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2020-09-15",publisher:i,subtitle:a}}]}}},meta:{}}},prerenderedAt:1681703426187}}("","Max Brallier",null,"series","movie",1,"The Last Kids on Earth","2019-08-01","Penguin"))